import React, { useState } from 'react';
import Button from './Button';
import Display from './Display';
import ConfettiExplosion from 'react-confetti-explosion';
import './Calculator.css';


const Calculator = () => {
    const [input, setInput] = useState('');
    const [result, setResult] = useState('');
    const [showConfetti, setShowConfetti] = useState(false);
    const [memory, setMemory] = useState(0);
    const [degreeMode, setDegreeMode] = useState(true);
    const [useSecondaryFunctions, setUseSecondaryFunctions] = useState(false);

    const handleButtonClick = (label) => {
      if (label === '=') {
        evaluateExpression();
      } else if (label === 'AC') {
        setInput('');
        setResult('');
      } else if (label === 'C') {
        setInput(input.slice(0, -1));
        setResult('');
      } else if (label === '+/-') {
        setInput((prev) => (prev.startsWith('-') ? prev.slice(1) : '-' + prev));
      } else if (label === 'MC') {
        setMemory(0);
      } else if (label === 'M+') {
        setMemory((prev) => prev + parseFloat(result || input || 0));
      } else if (label === 'M-') {
        setMemory((prev) => prev - parseFloat(result || input || 0));
      } else if (label === 'MR') {
        setInput(memory.toString());
      } else if (label === 'Rad') {
        setDegreeMode(!degreeMode);
      } else if (label.match(/^[0-9\.]+$/)) {
        setInput(input + label);
      } else if (label === '+' || label === '-' || label === '×' || label === '÷') {
        setInput(input + label);
      } else if (label === '%') {
        setResult((parseFloat(input) / 100).toString());
        setInput((parseFloat(input) / 100).toString());
      } else if (label === '2nd') {
        setUseSecondaryFunctions(!useSecondaryFunctions);
      } else {
        setInput(input + label);
      }
    };

    const evaluateExpression = () => {
      try {
        let evaluation = input.replace('×', '*').replace('÷', '/').replace('−', '-');
        // Replace function names with JavaScript Math functions
        evaluation = evaluation
          .replace('sin', 'Math.sin')
          .replace('cos', 'Math.cos')
          .replace('tan', 'Math.tan')
          .replace('sinh', 'Math.sinh')
          .replace('cosh', 'Math.cosh')
          .replace('tanh', 'Math.tanh')
          .replace('ln', 'Math.log')
          .replace('log₁₀', 'Math.log10')
          .replace('π', 'Math.PI')
          .replace('e', 'Math.E');

        // Add degree to radian conversion if needed
        if (degreeMode) {
          evaluation = evaluation.replace(/Math\.sin\((.*?)\)/g, 'Math.sin($1 * (Math.PI / 180))');
          evaluation = evaluation.replace(/Math\.cos\((.*?)\)/g, 'Math.cos($1 * (Math.PI / 180))');
          evaluation = evaluation.replace(/Math\.tan\((.*?)\)/g, 'Math.tan($1 * (Math.PI / 180))');
        }

        const resultValue = eval(evaluation);
        setResult(resultValue);
        setInput(resultValue.toString());

        if (input.includes('5') && input.includes('6')) {
          setShowConfetti(true);
          setTimeout(() => setShowConfetti(false), 1500);
        }
      } catch (e) {
        setResult('Error');
      }
    };

    const factorial = (n) => {
      if (n < 0) return 'Error';
      if (n === 0) return 1;
      return n * factorial(n - 1);
    };
  return (
    <div className="calculator">
      <Display value={result || input || '0'} />
      <div className="buttons">


        {['(', ')', 'mc', 'm+', 'm-', 'mr', 'C', '+/-', '%', '÷', '2nd','x²','x³','xʸ','eˣ','10ˣ','7','8','9'
         , '×','1/x','²√x','³√x','ʸ√x','ln','log₁₀','4','5','6','-','x!','sin','cos','tan','e','EE','1','2','3','+'
          ,'Rad','sinh','cosh','tanh','π','Rand','0','.','='
        ].map((label) => (
          <Button key={label} label={label} onClick={label === '2nd' || label === 'eˣ' ||
             label === '10ˣ' || label === '1/x' || label === 'x!' || label === 'ln' || 
             label === 'log₁₀' || label === 'x²' || label === 'x³' || label === 'xʸ' || 
             label === '²√x' || label === '³√x' || label === 'ʸ√x' || label === 'sin' ||
              label === 'cos' || label === 'tan' || label === 'sinh' || label === 'cosh' ||
               label === 'tanh' || label === 'π' || label === 'e' || label === 'EE' || 
               label === 'Rand' ? () => calculateAdvanced(label) : handleButtonClick} 

               className={['+', '-', '×', '÷', '=', '.'].includes(label) ? 'button operator':
                ['1', '2', '3', '4', '5', '6', '7', '8', '9'].includes(label) ? 'button number' : 
          label === '0' ? 'button zero' : 'button'} />

        ))}
      </div>
      {showConfetti && <ConfettiExplosion />}
    </div>
  );
};

export default Calculator;
